// JoinedStudent.js
import React, { useEffect, useState } from "react";
import NavbarEmployer from "../Employer/NavbarEmployer";

const JoinedStudent = () => {
  const [applicants, setApplicants] = useState([]);

  useEffect(() => {
    const fetchApplicants = async () => {
      try {
        const response = await fetch("http://localhost:5000/employer/applicants", {
          headers: {
            "Content-Type": "application/json",
            Authorization: `Bearer ${localStorage.getItem("access_token")}`,
          },
        });
        if (response.ok) {
          const data = await response.json();
          setApplicants(data);
        } else {
          console.error("Failed to fetch applicants");
        }
      } catch (error) {
        console.error("Error:", error);
      }
    };

    fetchApplicants();
  }, []);

  return (
    <div>
      <NavbarEmployer />
      <h1>Applicants</h1>
      <ul>
        {applicants.map((applicant) => (
          <li key={applicant.application_id}>
            <p>Name: {applicant.seeker_name}</p>
            <p>Email: {applicant.seeker_email}</p>
            <p>Job Title: {applicant.job_title}</p>
            <a href={`http://localhost:5000/uploads/${applicant.resume.split("/").pop()}`} target="_blank" rel="noopener noreferrer">
              View Resume
            </a>
          </li>
        ))}
      </ul>
    </div>
  );
};

export default JoinedStudent;
